import {
  Stepper,
  Step,
  StepLabel,
  StepButton,
  makeStyles,
} from "@material-ui/core";

import "./Sample2.css";
const Sample2 = (props) => {
  const useStyles = makeStyles(() => ({
    root: {
      "& .MuiStepIcon-active": { color: "red" },
      "& .MuiStepIcon-completed": { color: "green" },
      "& .Mui-disabled .MuiStepIcon-root": { color: "cyan" },
    },
  }));

  const c = useStyles();

  return (
    <section className="sec">
      <Stepper className={c.root} activeStep={props.activeStep}>
        <Step index={3} label="ثبت چک لیست">
          <StepButton>Register your name</StepButton>
        </Step>
        <Step index={2} label="تعریف افراد">
          {" "}
          <StepLabel>Register your email</StepLabel>
        </Step>
        <Step index={1} label="تعریف زون ها">
          <StepLabel>Click on Finish</StepLabel>
        </Step>
        <Step className="cn2" index={0} label="اطلاعات اصلی">
          <StepLabel>Click on Finish</StepLabel>
        </Step>
      </Stepper>
    </section>
  );
};

export default Sample2;
